import React from 'react';
import FinanceStats from '../../components/FinanceStats';
import View from '../../components/View';
import Table from '../../components/Table';

const Dashboard = () => {
    const columns = [
        { label: 'Data', field: '' },
        { label: 'Histórico', field: '' },
        { label: 'Valor', field: '' }
    ]

    return (
        <View
            title="Dashboard"
        >
            <FinanceStats />
            <Table
                columns={columns}
            />
        </View>
    )
}

export default Dashboard;
